import React, { useState } from 'react'

const Login = () => {

  const [formData,setFormData]= useState({
    userame:'',
    email:'',
    password:''
  });

  const handleChange=(e)=>{
    setFormData({...formData, [e.target.name]:e.target.value})
  }
  const handleSubmit=(e)=>{
    e.preventDefault();
    // axios.post("http://lcalhost:4000/login",formData)
    console.log("hello world")
  }

  return (
    <div >
      <form onSubmit={handleSubmit}>
        <input type='text' name='username' className='h-8 border ' />
        <input  type='email' name='email' className='h-8 border'/>
        <input type='password' name='password' className='h-8 border'/>
        <button type='submit' className='bg-green-500 border'>submit</button>
      </form>
      <div>
        <p>if you haven,t an account? </p>
      </div>
    </div>
  )
}

export default Login;
